import { border } from '@chakra-ui/react'
import Card from './Card'
import './App.css'
import axios from 'axios'



const Home = () => {

const [search, setSearch] = useState('')
const [myData, setMyData] = useState([])


    const hello = () => {
        fetch('/login', {
          method: 'GET',
        })
          .then((res) => res.json())
          .then((data) => {
            console.log(data);
          })
          .catch((error) => {
            console.log('Error:', error);
          });
      };


    //   const getSong = async() =>{
